
fn getmin (grid: &Vec<Vec<i32>>) -> i32 {
    *grid.iter().flatten().min().unwrap_or(&i32::MAX)
}
fn getmax (grid: &Vec<Vec<i32>>) -> i32 {
    *grid.iter().flatten().max().unwrap_or(&i32::MAX)
}
fn getpos (grid: &Vec<Vec<i32>>, val: i32) -> (usize,usize) {

    for y in 0..grid.len() {
        for x in 0..grid[0].len() {
            if grid[y][x] == val { return (x,y) }
        }
    }

    (0,0)
}

fn isinside (grid: &Vec<Vec<i32>>, x: i32, y: i32) -> bool {
    x >= 0 && y >= 0 && y < grid.len() as i32 && x < grid[0].len() as i32
}
fn scan_area (grid: &mut Vec<Vec<i32>>, src: (usize,usize)) -> i32 {

    let compas = [(0,-1),(1,0),(0,1),(-1,0)];
    let depth = grid[src.1][src.0];

    let mut sum = 0;
    let mut height = i32::MAX;
    let mut valid = true;
    let mut stack = vec![src];
    let mut area: Vec<(usize,usize)> = Vec::new() ;

    while !stack.is_empty() {

        let u = *stack.last().unwrap();
        stack.pop();

        if !area.contains (&u) { area.push(u) }

        for pos in compas {
            let nx = pos.0 + u.0 as i32;
            let ny = pos.1 + u.1 as i32;

            if isinside (grid, nx, ny) {
                let nxt = (nx as usize, ny as usize);
                let cell = grid[nxt.1][nxt.0];

                if cell == depth {
                    if !area.contains (&nxt) {
                        stack.push (nxt);
                    }
                } else  {
                    height = std::cmp::min (height, cell);
                }
            } else {
                valid = false;
            }
        }
    }

    for p in area {
        if valid { sum += height - depth }

        grid[p.1][p.0] = height;
    }

    sum
}
fn volume (grid: &Vec<Vec<i32>>) -> i32 {

    let top = getmax (grid);
    let mut sweep = getmin (&grid);
    let mut sum = 0;
    let mut grid = grid.clone();

    while sweep != top {
        let pos = getpos (&grid, sweep);
        sum += scan_area (&mut grid, pos);
        sweep = getmin (&grid);
    }

    sum
}

fn display (grid: &Vec<Vec<i32>>) {
    print! ("vec![");

    for y in 0..grid.len() {
        print! ("vec![");
        for x in 0..grid[0].len() {
            print! ("{}", grid[y][x]);
            if x < grid[0].len() - 1 { print! (",") }
        }
        print! ("]");
        if y < grid.len() - 1 { print! (",") }
    }
    print! ("]\n");
}

